import React, { useState } from 'react';
import * as S from './ExpenseFilter.style';

const ExpenseFilter = (props) => {

    return (
        <S.MainWrapper>
            <S.LabelWrapper>
            <S.Label>Filter Date By Year</S.Label>
            </S.LabelWrapper>
            <S.OptionsWrapper>
                <S.Select>
                    <S.Options>2019</S.Options>
                    <S.Options>2020</S.Options>
                    <S.Options>2021</S.Options>
                    <S.Options>2022</S.Options>
                </S.Select>
            </S.OptionsWrapper>
        </S.MainWrapper>
    );
}

export default ExpenseFilter;
